import { useEffect, useState } from "react";
import { useAppDispatch, useAppSelector } from "../../app/hooks";
import { logout } from "../../services/Auth/AuthSlice";
import './styles.css';
import CarCard from "./CarCard";
import { selectCarList } from "../../services/Car/CarSelectors";

// Define types for our new components
interface BookingFormData {
  pickupLocation: string;
  dropoffLocation: string;
  pickupDate: string;
  dropoffDate: string;
  carType: string;
}

interface Review {
  id: number;
  userName: string;
  rating: number;
  comment: string;
  date: string;
  avatar: string;
}

const Dashboard = () => {
  const [activeTime, setActiveTime] = useState('all');
  const [searchInput, setSearchInput] = useState('');
  const [isSearchModalOpen, setIsSearchModalOpen] = useState(false);
  const [showResults, setShowResults] = useState(false);
  const [activeTab, setActiveTab] = useState('all-cars');
  const [isFilterPageOpen, setIsFilterPageOpen] = useState(false);
  const [showLoginPage, setShowLoginPage] = useState(false);
  const { user, isLoading, error } = useAppSelector((state) => state.auth);
  const cars = useAppSelector(selectCarList);
  console.log('Cars:', cars);

  // New states for booking form
  const [bookingForm, setBookingForm] = useState<BookingFormData>({
    pickupLocation: '',
    dropoffLocation: '',
    pickupDate: '',
    dropoffDate: '',
    carType: 'all'
  }); 

  // Sample reviews data
  const [reviews, setReviews] = useState<Review[]>([
    {
      id: 1,
      userName: "John D.",
      rating: 5,
      comment: "Excellent service! The car was clean and in perfect condition.",
      date: "April 15, 2023",
      avatar: "/api/placeholder/40/40"
    },
    {
      id: 2,
      userName: "Sarah M.",
      rating: 4,
      comment: "Great experience overall. Pickup was fast and hassle-free.",
      date: "March 28, 2023",
      avatar: "/api/placeholder/40/40"
    },
    {
      id: 3,
      userName: "Robert K.",
      rating: 5,
      comment: "Best car rental service I've used. Will definitely rent again!",
      date: "April 2, 2023",
      avatar: "/api/placeholder/40/40"
    }
  ]);

  const dispatch = useAppDispatch();

  const handleSearchChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setSearchInput(e.target.value);
  };

  const handleSearchSubmit = (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    setIsSearchModalOpen(true);
  };

  const handleSearchClick = (e: React.MouseEvent<HTMLButtonElement, MouseEvent>) => {
    e.preventDefault();
    setIsSearchModalOpen(true);
  };

  const handleApplyFilters = (filters: any) => {
    console.log('Applied filters:', filters);
    setShowResults(true);
  };

  const handleLogout = () => {
    dispatch(logout());
  };

  const handleLoginButtonClick = () => {
    setShowLoginPage(true);
  };

  // Booking form handlers
  const handleBookingFormChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
    const { name, value } = e.target;
    setBookingForm(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleBookingSubmit = (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    console.log('Booking submitted:', bookingForm);
    // Here you would typically dispatch an action to submit the booking
    alert('Booking submitted successfully!');
  };

  // When user state changes and we have a user, return to homepage
  useEffect(() => {
    if (user) {
      setShowLoginPage(false);
    }
  }, [user]);

  const vehicleCategories = [
    { name: 'SUVs', icon: '🚙' },
    { name: 'Compact cars', icon: '🚗' },
    { name: 'Luxury cars', icon: '🏎️' },
    { name: 'Economy', icon: '💰' },
  ];

  const carListings = [
    {
      id: 1,
      name: 'Luxury Sedan (Gasoline)',
      type: 'Sedan',
      fuelType: 'Gasoline',
      location: 'Downtown',
      date: '17/08/2023',
      rate: '$50/day',
      city: 'City Center',
      image: '/api/placeholder/250/250'
    },
    {
      id: 2,
      name: 'Electric SUV (Battery)',
      type: 'SUV',
      fuelType: 'Electric',
      location: 'Uptown',
      date: '18/08/2023',
      rate: '$65/day',
      city: 'Metro Area',
      image: '/api/placeholder/250/250'
    },
    {
      id: 3,
      name: 'Compact Hybrid',
      type: 'Compact',
      fuelType: 'Hybrid',
      location: 'Airport',
      date: '19/08/2023',
      rate: '$45/day',
      city: 'Airport Zone',
      image: '/api/placeholder/250/250'
    }
  ];

  // Function to render stars based on rating
  const renderStars = (rating: number) => {
    const stars = [];
    for (let i = 1; i <= 5; i++) {
      stars.push(
        <span key={i} className={`star ${i <= rating ? 'filled' : 'empty'}`}>
          {i <= rating ? '★' : '☆'}
        </span>
      );
    }
    return stars;
  };

  // Results page view
  const renderResultsPage = () => (
    <div className="results-container">
      {/* Tabs */}
      <div className="tabs-container">
        <button 
          className={`tab ${activeTab === 'your-bookings' ? 'active-tab' : ''}`}
          onClick={() => setActiveTab('your-bookings')}
        >
          Your Bookings
        </button>
        <button 
          className={`tab ${activeTab === 'all-cars' ? 'active-tab' : ''}`}
          onClick={() => setActiveTab('all-cars')}
        >
          All Cars
        </button>
      </div>

      {/* Car Listings */}
      <div className="car-listings">
        {carListings.map((car) => (
          <div key={car.id} className="car-listing-item">
            {/* Car Image */}
            <div className="car-image">
              <img src={car.image} alt={car.name} />
            </div>

            {/* Car Details */}
            <div className="car-details">
              <h3>{car.name}</h3>
              <p>{car.city} - {car.date}</p>
              <p className="car-rate">Rate: {car.rate}</p>
              <p>Location: {car.location}</p>

              {/* Right Arrow */}
              <div className="car-arrow">▶</div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );

  return (
    <div className="app-container">

      {/* Main Content */}
      {showResults ? (
        renderResultsPage()
      ) : (
        <main>
          {/* Hero Section */}
          <section className="hero-section">
            <div className="hero-image">
              <img src="https://advertising.expedia.com/wp-content/uploads/2020/08/Car-Hero_1920x800.jpg" alt="Car Banner" />
            </div>
            <div className="hero-content">
              <h1>Discover the perfect ride for your journey.</h1>
              <div className="search-form-container">
                <form onSubmit={handleSearchSubmit}>
                  <input 
                    type="text" 
                    placeholder="Enter location or car model" 
                    value={searchInput}
                    onChange={handleSearchChange}
                  />
                  <button className="search-button">Search</button>
                </form>
              </div>
              <p>Book your ideal car with ease and convenience at the most competitive rates.</p>
            </div>
          </section>

          {/* Vehicle Categories */}
          <section className="categories-section">
            <div className="categories-grid">
              {vehicleCategories.map((category, index) => (
                <button key={index} className="category-button">
                  <span className="category-icon">{category.icon}</span>
                  <span>{category.name}</span>
                </button>
              ))}
            </div>
          </section>

          {/* Popular in New York */}
          <section className="popular-section">
            <h2>Popular in New York</h2>
            <div className="time-filters">
              <button 
                className={`time-filter ${activeTime === 'all' ? 'active-filter' : ''}`}
                onClick={() => setActiveTime('all')}
              >
                All
              </button>
              <button 
                className={`time-filter ${activeTime === 'today' ? 'active-filter' : ''}`}
                onClick={() => setActiveTime('today')}
              >
                Today
              </button>
              <button 
                className={`time-filter ${activeTime === 'tomorrow' ? 'active-filter' : ''}`}
                onClick={() => setActiveTime('tomorrow')}
              >
                Tomorrow
              </button>
              <button 
                className={`time-filter ${activeTime === 'this-week' ? 'active-filter' : ''}`}
                onClick={() => setActiveTime('this-week')}
              >
                This week
              </button>
              <button 
                className={`time-filter ${activeTime === 'next-week' ? 'active-filter' : ''}`}
                onClick={() => setActiveTime('next-week')}
              >
                Next week
              </button>
            </div>
            <div className="cars-grid">
              {cars.filter((car) => (car.State === user?.state)).slice(0, 10).map((car) => (
                <CarCard key={car.Car_Id} {...car} />
              ))}
            </div>
          </section>

          {/* NEW SECTION: Booking Reservation Area */}
          <section className="booking-section">
            <h2>Make a Reservation</h2>
            <div className="booking-container">
              <div className="booking-image">
                <img src="/api/placeholder/400/300" alt="Car Booking" />
              </div>
              <div className="booking-form-container">
                <form onSubmit={handleBookingSubmit}>
                  <div className="form-row">
                    <div className="form-group">
                      <label htmlFor="pickupLocation">Pickup Location</label>
                      <input 
                        type="text" 
                        id="pickupLocation" 
                        name="pickupLocation" 
                        value={bookingForm.pickupLocation} 
                        onChange={handleBookingFormChange} 
                        placeholder="Enter pickup location"
                        required
                      />
                    </div>
                    <div className="form-group">
                      <label htmlFor="dropoffLocation">Drop-off Location</label>
                      <input 
                        type="text" 
                        id="dropoffLocation" 
                        name="dropoffLocation" 
                        value={bookingForm.dropoffLocation} 
                        onChange={handleBookingFormChange} 
                        placeholder="Enter drop-off location"
                        required
                      />
                    </div>
                  </div>
                  <div className="form-row">
                    <div className="form-group">
                      <label htmlFor="pickupDate">Pickup Date</label>
                      <input 
                        type="date" 
                        id="pickupDate" 
                        name="pickupDate" 
                        value={bookingForm.pickupDate} 
                        onChange={handleBookingFormChange} 
                        required
                      />
                    </div>
                    <div className="form-group">
                      <label htmlFor="dropoffDate">Drop-off Date</label>
                      <input 
                        type="date" 
                        id="dropoffDate" 
                        name="dropoffDate" 
                        value={bookingForm.dropoffDate} 
                        onChange={handleBookingFormChange} 
                        required
                      />
                    </div>
                  </div>
                  <div className="form-row">
                    <div className="form-group full-width">
                      <label htmlFor="carType">Car Type</label>
                      <select 
                        id="carType" 
                        name="carType" 
                        value={bookingForm.carType} 
                        onChange={handleBookingFormChange}
                      >
                        <option value="all">All Types</option>
                        {/* <option value="suv">SUV</option> */}
                        <option value="sedan">Sedan</option>
                        {/* <option value="compact">Compact</option> */}
                        <option value="luxury">Luxury</option>
                      </select>
                    </div>
                  </div>
                  <button type="submit" className="booking-submit-button">Book Now</button>
                </form>
              </div>
            </div>
          </section>

          {/* NEW SECTION: Customer Reviews Area */}
          <section className="reviews-section">
            <h2>Customer Reviews</h2>
            <div className="reviews-container">
              {reviews.map(review => (
                <div key={review.id} className="review-card">
                  <div className="review-header">
                    <div className="reviewer-info">
                      <img src={review.avatar} alt={review.userName} className="reviewer-avatar" />
                      <div className="reviewer-details">
                        <h4>{review.userName}</h4>
                        <p className="review-date">{review.date}</p>
                      </div>
                    </div>
                    <div className="review-rating">
                      {renderStars(review.rating)}
                    </div>
                  </div>
                  <div className="review-content">
                    <p>{review.comment}</p>
                  </div>
                </div>
              ))}
            </div>
            <div className="write-review-container">
              <button className="write-review-button">Write a Review</button>
            </div>
          </section>
        </main>
      )}

      {/* Search Modal */}
      {isSearchModalOpen && (
        <div className="modal-overlay">
          <div className="modal">
            <button className="close-button" onClick={() => setIsSearchModalOpen(false)}>×</button>
            <h2>Search</h2>
            <div className="search-filters">
              {/* Simple search filters would go here */}
              <div className="filter-group">
                <label>Location</label>
                <input type="text" placeholder="Enter location" />
              </div>
              <div className="filter-group">
                <label>Car Type</label>
                <select>
                  <option>All Types</option>
                  <option>SUV</option>
                  <option>Sedan</option>
                  <option>Compact</option>
                  <option>Luxury</option>
                </select>
              </div>
              <div className="filter-group">
                <label>Price Range</label>
                <div className="price-inputs">
                  <input type="number" placeholder="Min" />
                  <input type="number" placeholder="Max" />
                </div>
              </div>
            </div>
            <div className="modal-buttons">
              <button className="clear-button">Clear</button>
              <button className="apply-button" onClick={() => {
                handleApplyFilters({});
                setIsSearchModalOpen(false);
              }}>Apply</button>
            </div>
          </div>
        </div>
      )}

      {/* Filter Page */}
      {isFilterPageOpen && (
        <div className="filter-page">
          <div className="filter-header">
            <h2>Filters</h2>
            <button className="close-button" onClick={() => setIsFilterPageOpen(false)}>×</button>
          </div>
          <div className="filter-content">
            <div className="filter-section">
              <h3>Car Type</h3>
              <div className="checkbox-group">
                {vehicleCategories.map((category, index) => (
                  <label key={index} className="checkbox-label">
                    <input type="checkbox" />
                    {category.name}
                  </label>
                ))}
              </div>
            </div>
            <div className="filter-section">
              <h3>Price Range</h3>
              <div className="range-slider">
                <input type="range" min="0" max="500" />
                <div className="price-labels">
                  <span>$0</span>
                  <span>$500</span>
                </div>
              </div>
            </div>
            {/* <div className="filter-section">
              <h3>Features</h3>
              <div className="checkbox-group">
                <label className="checkbox-label">
                  <input type="checkbox" />
                  Air Conditioning
                </label>
                <label className="checkbox-label">
                  <input type="checkbox" />
                  GPS
                </label>
                <label className="checkbox-label">
                  <input type="checkbox" />
                  Bluetooth
                </label>
                <label className="checkbox-label">
                  <input type="checkbox" />
                  Child Seat
                </label>
              </div>
            </div> */}
          </div>
          <div className="filter-footer">
            <button className="clear-button">Clear All</button>
            <button 
              className="apply-button"
              onClick={() => {
                handleApplyFilters({});
                setIsFilterPageOpen(false);
              }}
            >
              Apply Filters
            </button>
          </div>
        </div>
      )}

      {/* Simple Footer */}
      {!showResults && (
        <footer className="footer">
          <div className="footer-content">
            <div className="footer-section">
              <h3>CarFlex Rentals</h3>
              <p>© 2022 CarFlex. All rights reserved.</p>
            </div>
            <div className="footer-links">
              <a href="#">About Us</a>
              <a href="#">Contact</a>
              <a href="#">Support</a>
              <a href="#">FAQ</a>
              <a href="#">Terms</a>
              <a href="#">Privacy</a>
            </div>
          </div>
        </footer>
      )}
    </div>
  );
};

export default Dashboard;
